/**
 * Enumerador de constantes de acciones
 */

export enum ActionsConstants{
    //Incrementar
    IncreaseCounterAction = '[Increase Counter] Increase Counter Action',
    //Decrementar
    DecreaseCounterAction = '[Decrease Counter] Decrease Counter Action',
    //Multiplicar
    MultiplyCounterAction = '[Multiply Counter] Multiply Counter Action',
    //Dividir
    DivideCounterAction = '[Divide Counter] Divide Counter Action',
    //Reiniciar contador
    ResetCounterAction = '[Reset Counter] Reset Counter Action',
}
